    func addSession(isNewSession: Bool) {
        if (isNewSession) {
            currentSession = ChatSession(messages: [], bodyParts: [], symptoms: [], severities: [], title: "Chat Session2", date: getDateAsString(date: Date.now), colour: getRandomColor())
