    struct TotalSummaryResponse: Codable {
        var total_summary: String
    }
    
    func getTotalSummary(authorId: String, authorInfo: [String], summaries: [String]) async -> String {
        let endpoint = "/get_total_summary"
        
        let dataToSend: [String: Any] = [
            "user_id": authorId,
            "info": authorInfo,
            "summaries": summaries
        ]
        
        if let url = URL(string: baseUrl + endpoint) {
            var request = URLRequest(url: url)
            request.httpMethod = "POST"
            request.addValue("application/json", forHTTPHeaderField: "Content-Type")
            
            do {
                request.httpBody = try JSONSerialization.data(withJSONObject: dataToSend)
                let (data, _) = try await URLSession.shared.data(for: request)
                let decoder = JSONDecoder()
                
                let apiResponse = try decoder.decode(TotalSummaryResponse.self, from: data) // Decode the incoming JSON into a Swift struct
                let totalSummary = apiResponse.total_summary
                let totalSummaryData = Data(totalSummary.utf8)
                var decodedTotalSummaryData = try JSONDecoder().decode(String.self, from: totalSummaryData)
                
                return decodedTotalSummaryData
            } catch {
                print("POST Request Failed:", error)
            }
        }
        
        return "FAILED"
    }
    
    func summariseConversation(authorId: String, authorName: String, HKM: HealthKitManager) async {
        let endpoint = "/summarise_discussion"
        
        let messagesArray: [String] = currentSession.messages.map {
            $0.content
        }
        let dataToSend: [String: Any] = [
            "user_id": authorId,
            "user_name": authorName,
            "messages": messagesArray
        ]
        
        if let url = URL(string: baseUrl + endpoint) {
            var request = URLRequest(url: url)
            request.httpMethod = "POST"
            request.addValue("application/json", forHTTPHeaderField: "Content-Type")
            
            do {
                request.httpBody = try JSONSerialization.data(withJSONObject: dataToSend)
                let (data, _) = try await URLSession.shared.data(for: request)
                let decoder = JSONDecoder()
                let apiResponse = try decoder.decode(SummaryResponse.self, from: data) // Extract retrieved JSON object into a SummaryResponse object.
                
                // Values of the object are JSON.dumps() encoded though, so we need to decode each one.
                let summarisedTitle = apiResponse.response // Isolate the field
                let summarisedTitleData = Data(summarisedTitle.utf8) // Make into a UTF8 data object
                let decodedSummarisedTitle = try JSONDecoder().decode(String.self, from: summarisedTitleData) // Decode this into a Swift string, so removing the JSON encoded slashes.
                
                
//                let medication = try JSONDecoder().decode(MedicationResponse.self, from: apiResponse.medication) // Decode this into a Medication object.
                
                let summary = apiResponse.summary
                let summaryData = Data(summary.utf8)
                var decodedSummaryData = try JSONDecoder().decode(String.self, from: summaryData)
                
                // Append Apple Health Metrics to the summary.
                if (HKM.haveAccess) {
                    decodedSummaryData.append("\n\n**Apple Health Metrics:**")
                    if let metric = HKM.stepCountToday { decodedSummaryData.append("\n- Steps: \(metric)") }
                    if let metric = HKM.HRV { decodedSummaryData.append("\n- Heart Rate Variability: \(metric)") }
                    if let metric = HKM.heartRate { decodedSummaryData.append("\n- Heart Rate: \(metric)") }
                    if let metric = HKM.respiratoryRate { decodedSummaryData.append("\n- Respiratory Rate: \(metric)") }
                    if let metric = HKM.bodyTemperature { decodedSummaryData.append("\n- Body Temperature: \(metric)") }
                    if let metric = HKM.weight { decodedSummaryData.append("\n- Weight: \(metric)") }
                    if let metric = HKM.BMI { decodedSummaryData.append("\n- BMI: \(metric)") }
                    if let metric = HKM.sleep { decodedSummaryData.append("\n- Sleep: \(metric)") }
                    if let metric = HKM.menstrualFlow { decodedSummaryData.append("\n- Menstrual Flow: \(metric)") }
                }
                
                print(decodedSummarisedTitle)
                print(decodedSummaryData)
                
                let bodyParts = apiResponse.body_parts
                let bodyPartsData = Data(bodyParts.utf8)
                let decodedArray = try JSONDecoder().decode(String.self, from: bodyPartsData)
                let bodyPartsData2 = Data(decodedArray.utf8)
                let decodedArray2 = try JSONDecoder().decode([[String]].self, from: bodyPartsData2)
                print(decodedArray2)
                
//                let actualArray = decodedArray.array
                currentSession.title = decodedSummarisedTitle
                currentSession.summary = decodedSummaryData
                
                let bodyPartsArray: [BodyPart] = decodedArray2.map { bodyPartArrayMapping in
                    BodyPart(rawValue: bodyPartArrayMapping[1])!
                }   
                
                let symptomsArray: [String] = decodedArray2.map { bodyPartArrayMapping in
                    bodyPartArrayMapping[0]
                }
                
                let severitiesArray: [String] = decodedArray2.map { bodyPartArrayMapping in
                    bodyPartArrayMapping[2]
                }
                
                currentSession.bodyParts = bodyPartsArray
                currentSession.symptoms = symptomsArray
                currentSession.severities = severitiesArray
            } catch {
                print("POST Request Failed:", error)
            }
        }
    }
    
